      '<div align="left">After three years of waiting, Marcus Gad &amp; Tribe finally deliver their new creation, Ready For Battle. It\'s the fourth studio album by the New Caledonian artist working together with his band Tribe, which began backing Gad in 2017 for the album Chanting. The record releases digitally in North America on February 10, with the physical versions (double LP vinyl and CD) coming out on March 3 within the territory. Check it out <a href="https://r20.rs6.net/tn.jsp?f=001e7hnS-vXw9-iWGR17qLAwwAlaa94vkNLnCR_a2U0YS8RsAP6ST0jupg5hDEhHAzAf-1tfckMtFpUqmGF6ui_xmo7ZxAzuRpSlq3_6HgMvSA_nlYyBVFHnbxm36Zlj3mifI-ZpZSnwlCkGYOakprgBTL9FHth9cgdDamLF-f_BU0=&amp;c=w6dXtE8S_jVMuG58DssZxE_yRwPlFKtgjKi0hRF_v2h5uADW_ZgREA==&amp;ch=rocyqpziCeZW6EVHJ8l_gQ-hGdydCP8ihuMTBMiKykd5dKs_smRaNw==" target="_blank" rel="noopener noreferrer">here</a>.</div>\r\n<div align="left"></div>\r\n<div align="left">Ready For Battle revisits recurring themes that Marcus Gad has wrestled with in his music throughout his young career: cultivating a spiritual conscience in yourself; deep love and praise for nature; pushing for a collective awakening to change our current way of living before it destroys us and our world. These topics have always been important but have become even more essential to champion in our post-pandemic existence. With this album, Marcus Gad shares a message that stays true to his guiding principle: two feet planted on the ground, head in the cosmos.</div>\r\n<div align="left"></div>\r\n<div align="left">Although the album was written and recorded between 2018 and 2019, in a world not yet subject to the drastic rules put in place to survive the global health crisis, Marcus was already practicing what he preached, striving to live consciously, and urging others to follow his lead. At that time, the songs Gad wrote for this album in many ways foretold what awaited us, but they feel just as resonant now: an invitation to take advantage of our fundamental rights, which for many seemed to be taken for granted. Ready For Battle was prescient: we were going to have to prepare to defend our rights, our humanity, and our resources. This has only become clearer upon release of the album a few years later.</div>\r\n<div align="left"></div>\r\n<div align="left">Marcus Gad reminds us that we are up against the manipulations of multinationals and complicit governments that, in the name of economic growth, privatize and dispossess primordial resources such as water, or genetically modify the staple crops that feed humanity. For this reason, he calls for battle; not of actual physical war, but of resistance to a model that he considers outdated, armed with our spiritual, individual, and collective consciences, our will to maintain our status as free human beings, and to rethink our lives to be more in accordance with our environment. Ready For Battle\'s 14 tracks are a call for solidarity in opposition to the individualistic, profit-driven world that divides us and conquers us.</div>\r\n<div align="left"></div>\r\n<div align="left">Musically, this record also exemplifies this collective approach, as it was recorded live in the studio, with all the musicians playing together at the same time, as opposed to the more traditional method of individual studio sessions and overdubs. This group work in the studio allows for artistic emulation, small changes in tempo, spontaneous touches of color, and a tighter overall sound, especially with a top notch band like Tribe working so hard to achieve unity in the sessions. Following the unique sidestep release of Brave New World (also out on Easy Star - 2021), which featured Marcus working with producer Tamal on more programmed and electronically created tracks, Ready For Battle returns Gad &amp; Tribe to their unique musical family unit, sounding a sonic war cry that cannot be ignored.</div>\r\n<div align="left"></div>\r\n<div align="left">Listen: <a href="https://r20.rs6.net/tn.jsp?f=001e7hnS-vXw9-iWGR17qLAwwAlaa94vkNLnCR_a2U0YS8RsAP6ST0jupg5hDEhHAzANqI_4hHOO4Ea-wpUeErV3SHGOEXKvy3wHVj3z-SdPBuFm09YozUM4RnN8kbmYnS4Np_PH3xNJYbQh5lqXVyvh7K53d-cZiyOtOhGdlARKFFvjeXYfMSWg7Wz0hQ8znn3Nqi3JXkQ6o37c-qq-89rA9y2nN40hJmIaQ5bHJ0piNFVg0-PRvzRhWRL3u8-nHYnZrF0IW8uLSEKiJD6kLCOxeWu9Cc51h5xOhiq6cmt6myBPXTBiAr1tq0mWj8a2wGk_ujDnep8AxJ76Vvvjm8m_9XJIEuaN8ob4PncdeYp3u153_vxBd2nSd98JqrLTZ14ZMFSLt3QqoAo7GC8LgwGOZYlCoe1rQVu5R7ep-PMzS8iBKGOZ8T6q_U8Wu3RJguABLXZQQCN58VI6szRsH0VProkTt4Azce9lSC2q436qdN3x0PUgdSHKqgMtOjfzugbQvWHsEbLOPDoWsfjrpekoMCpOfdpTS5889cpe5_Cl5TMtvDg_4wOmzmSZJzCHI9BuaTdWX5gHEl0NNdeEILLSQ==&amp;c=w6dXtE8S_jVMuG58DssZxE_yRwPlFKtgjKi0hRF_v2h5uADW_ZgREA==&amp;ch=rocyqpziCeZW6EVHJ8l_gQ-hGdydCP8ihuMTBMiKykd5dKs_smRaNw==" target="_blank" rel="noopener noreferrer">https://moremusic.at/ReadyForBattleAlbum</a></div>\r\n<div align="left"></div>\r\n<div align="left"><a href="https://r20.rs6.net/tn.jsp?f=001e7hnS-vXw9-iWGR17qLAwwAlaa94vkNLnCR_a2U0YS8RsAP6ST0juv8CO12Zh891l-25rQKzv6ozpedGwAU17eVzM3KAgEUZtkFHXfaT60mHToeACWWDZgU6OA4cx18IRhHOekNWds8oPU1vdWYD_N_n44Mj_Mman64WxHHHLtnSQo_92jJJAQ==&amp;c=w6dXtE8S_jVMuG58DssZxE_yRwPlFKtgjKi0hRF_v2h5uADW_ZgREA==&amp;ch=rocyqpziCeZW6EVHJ8l_gQ-hGdydCP8ihuMTBMiKykd5dKs_smRaNw==" target="_blank" rel="noopener noreferrer">https://www.facebook.com/Marcus.Gad.Official/</a></div>\r\n<div align="left"><a href="https://r20.rs6.net/tn.jsp?f=001e7hnS-vXw9-iWGR17qLAwwAlaa94vkNLnCR_a2U0YS8RsAP6ST0juv8CO12Zh891hIqkvzUxh41o4Ga7FRQiTZEMoCAh9Gxljf1Ck0yAwkPFqomdyCzRk3167O5xrFq-J5vXTXOMCSE7XfyyhDytnHP9jYGxB6YN-rIBz_Lz-kY=&amp;c=w6dXtE8S_jVMuG58DssZxE_yRwPlFKtgjKi0hRF_v2h5uADW_ZgREA==&amp;ch=rocyqpziCeZW6EVHJ8l_gQ-hGdydCP8ihuMTBMiKykd5dKs_smRaNw==" target="_blank" rel="noopener noreferrer">https://www.instagram.com/marcusgadofficial/</a></div>\r\n<div align="left"><a href="https://r20.rs6.net/tn.jsp?f=001e7hnS-vXw9-iWGR17qLAwwAlaa94vkNLnCR_a2U0YS8RsAP6ST0juv8CO12Zh891rs8OVVdaEM3UCWNN_SxzYmyZy5QfSyiXz4ozOrxAjghINLS6l37FgVhEOsTZTSjFZ33SpfZg-OqmRENkDFSsASgx_vY_dzgo&amp;c=w6dXtE8S_jVMuG58DssZxE_yRwPlFKtgjKi0hRF_v2h5uADW_ZgREA==&amp;ch=rocyqpziCeZW6EVHJ8l_gQ-hGdydCP8ihuMTBMiKykd5dKs_smRaNw==" target="_blank" rel="noopener noreferrer">https://www.youtube.com/c/MarcusGad</a>\r\n\r\nCredits: <a href="https://PressJunkiePR.com" target="_blank" rel="noopener">PressJunkiePR</a></div>',
