    post_date_gmt: "2023-02-23 19:54:46",
    post_content:
      '<p class="v1western">Multi-talented fashion designer, <b>Jenelle Alexia</b>, is now a two-time author. The <i>A\'Legends Clothing</i> line owner has released her second book, a children\'s book titled <b><i>Keira Discovers Her Talent</i></b>, on the first day of 2023 after closing 2022 with a successful winter wonderland fashion show dubbed <i>The Hidden Treasure Fashion Show</i> held in Philadelphia on December 9. The book is somewhat a replica of her own childhood and mirrors similarities of her career coming up in the fashion industry.</p>\r\n<p class="v1western"><b><i>Keira Discovers Her Talent</i></b> is available online in digital format as well as hardcopies. The book and <i>A\'Legends</i> brand itself as of February 3, is physically purchasable inside the Culture Rocks store in the Gloucester Premium Outlet Mall located in Blackwood, New Jersey just 20 minutes outside of Philadelphia. This <b>Jenelle</b> says is the first of many store setups she is working on with the hopes of several others in various states jumping on board soon.\r\n<img class="size-full wp-image-32251 aligncenter" src="https://reggaefresh.com/wp-content/uploads/2023/02/discovers.jpg" alt="Keira Discovers Her Talent " width="550" height="656" /><b>Jenelle Alexia</b> is also working in collaboration with her PR Lesley Hayles in organizing an island book tour in schools, book and stationary stores of Jamaica at a convenient time that is yet to be confirmed. The motivational messages of <b><i>Keira Discovers Her Talent</i></b> would be a great educational tool for children, parents and teachers alike. As long as one has a dream, this book is sure to keep belief and hope alive.</p>\r\n<p class="v1western">Come June 2023, <b>Jenelle Alexia</b> will take part in the Runway Fashion Elite TV competition being held in Atlanta, Georgia with her <i>A\'Legends Clothing</i> brand. Dancehall artistes like Xyclone, Delly Ranx, Vershon and more have already been endorsing her designs, with a few big names in the music business getting on board. There are also other plans in the pipeline for this Philadelphia-based entrepreneur, hinting at music-related projects, possibly another acting gig after her film debut in the 3-11 movie alongside Macka Diamond, opening a boutique in Kingston, Jamaica and maybe even a <i>Keira</i> series of books to follow.</p>\r\n<p class="v1western">Stay tuned to <b>Jenelle Alexia</b>\'s Instagram pages for constant updates on what she\'s got going on.</p>\r\n<p class="v1western"><u><a href="http://www.instagram.com/alegends_" target="_blank" rel="noopener noreferrer">https://Instagram.com/alegends_</a></u>\r\n<u>https://Instagram.com/j_alexiabankx</u></p>\r\n<p class="v1western">Contact Lesley Hayles <u><a href="http://www.instagram.com/lesleyodyssey" target="_blank" rel="noopener noreferrer">@lesleyodyssey</a></u> to feature <b>Jenelle Alexia</b> or if you are interested in being a part of the book tour in any capacity.</p>\r\n<p class="v1western"><b><u>PURCHASE</u></b>\r\n<b><i>Keira Discovers Her Talent</i></b>: <a href="https://www.amazon.com/dp/B0BRL5D8XP" target="_blank" rel="noopener noreferrer">https://www.amazon.com/dp/B0BRL5D8XP</a>\r\n\r\nCredits: <i><a href="http://www.instagram.com/lesleyhaylesmusic" target="_blank" rel="noopener noreferrer">Lesley Hayles</a></i></p>',
