      'The recent traffic fines installed on the Jamaican people by the government has led to upcoming artiste Money Pallet to take things into his own hands and sing about the corruption of what the Jamaican government is doing. His new single \'Car Seat\' speaks of how can a public transport vehicle carry a child seat in a car or multiple child seats in a car. It wouldn\'t be feasible especially for a woman who has 3 or more kids. Check out his new single Child Seat now. Thank you for your support in bringing awareness to this unfairness to the Jamaican public\r\n\r\nDownload/Stream: <span class="yt-core-attributed-string--link-inherit-color"><a class="yt-core-attributed-string__link yt-core-attributed-string__link--display-type yt-core-attributed-string__link--call-to-action-color" tabindex="0" href="https://www.youtube.com/redirect?event=video_description&amp;redir_token=QUFFLUhqbnZfUTVrMl9sem5EMXltdXZyUk9HcDRMX05iQXxBQ3Jtc0trcUVEY2tINmo4dUg3Sk1VQ1JSS2VuNURFSGhvVVhlSEQxc1hFSHhWZEhnQ1o0SFpueFc2Tm8xMnJZb254bzA3UWJQcEVMRXZWOUVRMnVkdXdGa2ZFOVcwREVZajNPaVNxTmV4X0ZVUEdwTklxMXdzMA&amp;q=https%3A%2F%2Fonerpm.link%2Fmp-childseat&amp;v=uXklEQmppqM" target="_blank" rel="nofollow noopener">https://onerpm.link/mp-childseat</a>\r\n<iframe title="Money Pallet - Child Seat (Message to the Prime Minister) | Official Audio" src="https://www.youtube.com/embed/uXklEQmppqM" width="640" height="360" frameborder="0" allowfullscreen="allowfullscreen"></iframe></span>\r\n\r\n&nbsp;',
