      '<p dir="ltr"><strong>Run it Agency</strong> presents the mixtape <em><strong>Run Di Vibe 2022</strong></em>, mixed by <strong>Freedom Cry</strong> sound system from Cornellà (Barcelona). It includes 41 tracks taken from the albums, EPs and singles promoted by Run it Agency during last year.</p>\r\n<p dir="ltr"><em><strong>Run Di Vibe 2022</strong></em> can be heard on <a href="https://runitagency.us3.list-manage.com/track/click?u=d1ce25b5e360c3df7324cc026&amp;id=36f156b413&amp;e=920e37fe0f" target="_blank" rel="noopener noreferrer">Mixcloud</a> and it\'s available in <a href="https://runitagency.us3.list-manage.com/track/click?u=d1ce25b5e360c3df7324cc026&amp;id=3a6b8bc215&amp;e=920e37fe0f" target="_blank" rel="noopener noreferrer">free download</a>.\r\nTracklist\r\n1 - Queen Omega - Fittest (Baco Records)\r\n2 - Queen Omega - See You Down (Baco Records)\r\n3 - Queen Omega ft. Jalifa &amp; Kushite - Wise Queens (Baco Records)\r\n4 - Groundation - Human Race (album One Rock, Baco Records)\r\n5 - Groundation ft. The Congos - One Rock (album One Rock, Baco Records)\r\n6 - Groundation ft. Israel Vibration &amp; The Abyssinians - Original Riddim (album One Rock, Baco Records / Cumbancha)\r\n7 - Mista Savona ft. Clinton Fearon - The Human Chain (album Havana Meets Kingston vol. 2, Baco Records)\r\n8 - Marcus Gad - Ready For Battle (Baco Records)\r\n9 - Elijah Salomon - Herz Vomene Loi (album Salomon, One Camp Records)\r\n10 - Elijah Salomon - Three O\'Clock (album Salomon, One Camp Records)\r\n11 - Lady G - Nuh Fear Dem (EP Raggamuffin \'89, One Love Records)\r\n12 - PAPA Sound ft. Shvmpoo - Ray-Bans (ICEA)\r\n13 - Lee Fry ft. Sledge - Believe (EP Real Soldier, Lee Fry Music)\r\n14 - PAPA Sound ft. Macka Diamond - Money (ICEA)\r\n15 - PAPA Sound ft. Red Fox - Everybody Rock (ICEA)\r\n16 - Mellow Mood ft. Konshens - My Bed (album Mañana, La Tempesta Dub)\r\n17 - PAPA Sound ft. Wayne J - Discipline Child (ICEA)\r\n18 - Natalyah - Proper (VPAL Music)\r\n19 - Playa Desnuda - Primavera\r\n20 - Train To Roots - Ancora Qui (Metatron)\r\n21 - Chant Vibration - Rise And Shine (One Love Records)\r\n22 - Mellow Mood ft. Iya Terra - Make It Better (album Mañana, La Tempesta Dub)\r\n23 - Mellow Mood ft. Alborosie, Anthony B &amp; Emeterians - I and I Chant Remix (album Mañana, La Tempesta Dub)\r\n24 - Mista Savona ft. Brenda Navarrete, Dayán Carrera Fernández &amp; Randy Valentine - Siempre Sí (album Havana Meets Kingston vol. 2, Baco Records / Cumbancha)\r\n25 - Mike Brooks - Mother Earth (album Walking Talking, One Camp Records)\r\n26 - Mike Brooks - Walking Talking (album Walking Talking, One Camp Records)\r\n27 - Derrick Morgan - Forward March (album Rise Jamaica!, Trojan Records)\r\n28 - Jimmy Cliff - Miss Jamaica (album Rise Jamaica!, Trojan Records)\r\n29 - Don Drummond, Tommy McCook &amp; The Skatalites - (Music is) My Occupation (Ring Of Fire) (album Essential Artist Collection - The Skatalites, Trojan Records)\r\n30 - Don Drummond &amp; The Skatalites - Garden Of Love (album Essential Artist Collection - The Skatalites, Trojan Records)\r\n31 - The Maytals - One Eye Enos (album Essential Artist Collection - The Maytals, Trojan Records)\r\n32 - The Maytals - Just Tell Me (album Essential Artist Collection - The Maytals, Trojan Records)\r\n33 - Lee \'Scratch\' Perry - People Funny Boy (album King Scratch, Trojan Records)\r\n34 - Max Romeo &amp; Prince Jazzbo - One Step Forward / Ital Corner (12" mix) (album King Scratch, Trojan Records)\r\n35 - Dennis Bovell &amp; African Stone - Run Rasta Run (album The Dubmaster, Trojan Records)\r\n36 - Dennis Bovell &amp; The Dub Band - Dub Master (album The Dubmaster, Trojan Records)\r\n37 - Marcia Aitken - I\'m Still In Love With You (album Lovers Rock, Trojan Records)\r\n38 - Dennis Brown - Money In My Pocket (album Lovers Rock, Trojan Records)\r\n39 - Ras Sparrow - Atlantis Rising Dub (EP Dub In Stone, Ras Sparrow Records)\r\n40 - Wicked Dub Division meets North East Ska Jazz Orchestra - Moon (album Live Studio Sessions #1, Brixton Records)\r\n41 - Wicked Dub Division meets North East Ska Jazz Orchestra - Mama (album Live Studio Sessions #1, Brixton Records)\r\n<iframe src="https://www.mixcloud.com/widget/iframe/?hide_cover=1&amp;feed=%2Frunitagency%2Frun-di-vibe-2022-mixed-by-freedom-cry%2F" width="100%" height="120" frameborder="0"></iframe></p>',
