      '<p class="v1MsoNormal">African Dancehall artiste Sasco De Dancehall Chaplain is currently promoting his high energy dance track titled "Day Off." Produced by Sierra Leonean producer Sticks of Sticky Beats Production, the track was officially released in April 2021.</p>\r\n<p class="v1MsoNormal">"As the name "Day Off" implies, it\'s about people taking a break from work to engage in some social activities or partying in the sense of the song/track," the artiste explained. With the positive feedback to the track so far, he has high hopes for its success.</p>\r\n<p class="v1MsoNormal">"I hope that the song will be greatly appreciated all over the globe and that it will earn me a lot of local and international awards as some of its benefits by God\'s perfect grace," the artiste expressed.</p>\r\n<p class="v1MsoNormal">Hailing from Sierra Leone, Sasco De Dancehall Chaplain has been on the music scene for the past 12 years. His music style combines Reggae, Dancehall and Afro Beats, which are predominant sounds in Sierra Leone.</p>\r\n<p class="v1MsoNormal">"I decided to do music because it is my talent; I love it and I have passion for it. When I was in primary school, I used to sing for people and they used to give me money in return. That was how I later realized that I had musical talent and decided to pursue it as a career," he highlighted. Heavily influenced by Jamaican artistes such as Sean Paul, Busy Signal, Beenie Man, Bounty Killer, Demarco and Konshens, his goal is to visit the island soon as he considers it his "special home."</p>\r\n<p class="v1MsoNormal">With previous releases such as "Love Money Can\'t Buy", "Mad Over You", "Nuh Make Dem See We", "Bruk Out &amp; Whine" and "Brace Pon Yuh Man", the artiste is in the process of working on new music for release in the new year.</p>\r\n<p class="v1MsoNormal">"Day Off" is available for purchase and streaming on major digital platforms.</p>',
