      'Jamaican record producer, <b>Killa Imij</b>, is buzzing with his latest compilation called the <b><i>Buzzer Riddim</i></b> on the US iTunes Reggae Albums Chart. It was released to much anticipation on March 11, 2023. Sitting quite comfortably at number 2 since its release Friday night with only the late great Bob Marley himself in the top spot, <b>Killa Imij</b> is still very ecstatic about his placement of this project.\r\n\r\n<img src="https://reggaefresh.com/webmail/?_task=mail&amp;_action=get&amp;_mbox=INBOX&amp;_uid=6208&amp;_token=3tgF9oFHjXdUAard95mhvL7hlRbAKuFx&amp;_part=3&amp;_embed=1&amp;_mimeclass=image" width="457" height="467" align="left" /><br clear="left" /><b><i>Buzzer Riddim</i></b> was produced by <b>Killa Imij</b> himself under his <i>Killa Imij Records</i> label in collaboration with JayCrazie Records and LeadaBoss Music. Distributed by DistroKid and marketed by Ejor Media Group, <b><i>Buzzer Riddim</i></b> is a 14-track album with 13 artistes lending their voices to the beat. It features names such as Munga Honourable, Gaza Kym, Luton Fyah, Fantan Mojah, Wasp, Maestro Don, Bencil Clickstar, Javaughn Genius as well as acts like Eegle Hy, 9Grainz, Bla-Zinnoh, Kindolla and Ice Turner.\r\n\r\nMany songs from the <b><i>Buzzer Riddim</i></b> album has also charted on the US iTunes Reggae Songs Chart. Leading out is Maestro Don with "<i>Bloodbath</i>" at #22, followed by Munga Honourable with the radio edit of "<i>Wul Out</i>" at #23, then Wasp with "<i>Coward</i>" at #25, followed by Gaza Kym with "<i>Money Up</i>" at #29, 9Grainz with "<i>Champion</i>" at #31, Lutan Fyah peaked at #34 with "<i>Style</i>", Kindolla with his track "<i>Pressure</i>" reached as far as #56 and Bencil Clickstar at #77 with "<i>Killaimij</i>". The album peaked at #85 overall on the iTunes Global Charts.\r\n\r\n<img src="https://reggaefresh.com/webmail/?_task=mail&amp;_action=get&amp;_mbox=INBOX&amp;_uid=6208&amp;_token=3tgF9oFHjXdUAard95mhvL7hlRbAKuFx&amp;_part=4&amp;_embed=1&amp;_mimeclass=image" width="580" height="555" align="left" /><br clear="left" />The excitement he felt as family members and friends contacted him about his climb up the charts, <b>Killa Imij</b> says has been like a high he\'s never felt before and is loving every moment of it. Though he is yet to claim the number 1 spot, <b>Killa Imij</b> is content with second place knowing that an icon such as Bob Marley is the only one in his way.\r\n\r\n"<i>To peak at number 2 is good enough for me. It just means I gotta go harder next time and I will</i>," says a grateful <b>Killa Imij</b>.\r\n\r\nHis co-producers JayCrazie and LeadaBoss are just as excited about and appreciative of the success of <b><i>Buzzer Riddim</i></b>. However, there\'s so much more solo projects to come from this recording genius but the focus remains on the <b><i>Buzzer Riddim</i></b> for now and seeing how far it goes. <b>Killa Imij</b> will be working hard to not only get this project to new heights but to also get his name out there as one of the best producers in the Dancehall music industry. Stay tuned for updates from <i>Killa Imij Records</i>.\r\n\r\nFollow <b>Killa Imij</b> on Instagram here: <a href="http://www.instagram.com/killaimijrecords" target="_blank" rel="noopener noreferrer">www.instagram.com/killaimijrecords</a>\r\nPurchase or stream <b><i>Buzzer Riddim</i></b> here: <a href="https://distrokid.com/hyperfollow/killaimijandleadabossandjaycrazie/buzzer-riddim" target="_blank" rel="noopener noreferrer">https://distrokid.com/hyperfollow/killaimijandleadabossandjaycrazie/buzzer-riddim</a>\r\n\r\nCredits: <a href="http://www.instagram.com/lesleyodyssey" target="_blank" rel="noopener noreferrer">Lesley Hayles</a>',
